    this.coinSpinRight.scale.set(0.2);
    this.coinSpinRight.angle = 45;
    this.spin.addChild(this.coinSpinRight)
    this.spin.addChild(this.coinSpinLeft)

    this.coinRight = game.add.sprite(this.game.width*0.97,this.game.height*0.3,'atlas','coin.png');
    this.coinRight.anchor.set(0.5);
    this.coinRight.scale.set(0.6);
    this.coinRight.angle = 45;

    this.coinLeft = game.add.sprite(this.game.width*0.001,this.game.height*0.001,'atlas','coin.png');
    this.coinLeft.anchor.set(0.5);
    this.coinLeft.scale.set(0.6);
    this.coinLeft.angle = 25;

    this.msgCoins = game.add.sprite(this.game.width*0.5,this.game.height*0.45,'coins');
    this.msgCoins.anchor.set(0.5);
    this.msgCoins.scale.set(0);

    this.msgWin = game.add.sprite(this.game.width*0.5,this.game.height*0.5,'atlas','1w.png');
