    this.msgWinTween.onComplete.add(function(){this.msgWinTween2.start()})
    this.msgCoinsTween.onComplete.add(function(){this.msgCoinsTween2.start()})

    this.msgWinTween2.onComplete.add(function(){this.msgWin.scale.set(0);})
    this.msgCoinsTween2.onComplete.add(function(){this.msgCoins.scale.set(0);})
