function setCTA(){
    this.popup = game.add.sprite(this.game.width*0.5,this.game.height*0.4,'popup');
    this.popup.anchor.set(0.5);
    this.popup.scale.set(0);

    this.btnCTA = game.add.sprite(this.game.width*0.5,this.game.height*0.56,'atlas','2.png');
    this.btnCTA.anchor.set(0.5);
    this.btnCTA.scale.set(0);

    this.moneyRain = game.add.emitter(game.world.centerX, -32, 100);
    this.moneyRain.makeParticles('atlas', ['coin.png']);
    this.moneyRain.maxParticleScale = 0.25;
    this.moneyRain.minParticleScale = 0.1;
    this.moneyRain.setYSpeed(300, 500);
    this.moneyRain.setXSpeed(-50, 50);
    this.moneyRain.gravity = 150;
    this.moneyRain.width = game.world.width * 1.5;
    this.moneyRain.minRotation = -40;
    this.moneyRain.maxRotation = 80;

    this.popupTween = game.add.tween(this.popup.scale).to({ x: 1.1, y:1.1}, 300, Phaser.Easing.Sinusoidal.In).to({ x: 1, y: 1}, 250, Phaser.Easing.Sinusoidal.Out); 
    this.btnCTATween = game.add.tween(this.btnCTA.scale).to({ x: 1.35, y:1.35}, 300, Phaser.Easing.Sinusoidal.In).to({ x: 1.3, y: 1.3}, 250, Phaser.Easing.Sinusoidal.Out); 
    this.btnCTATween2 = game.add.tween(this.btnCTA.scale).to({ x: 1.4, y: 1.4}, 500, Phaser.Easing.Sinusoidal.InOut).to({ x: 1.3, y: 1.3}, 600, Phaser.Easing.Sinusoidal.InOut).yoyo(true).repeat(-1)
    this.btnCTATween.onComplete.add(function(){this.btnCTATween2.start()})
}

function createBars(){
    this.barGroup = game.add.group();
    this.graphics = game.add.graphics();

    for (var i = 0; i < 3; i++) {
         var bar = game.add.tileSprite(i * 200, 0,144,1530, "bar");
         this.barGroup.add(bar);
    }

    this.barGroup.x = this.game.width / 2 - this.barGroup.width / 2;
    this.barGroup.y = (this.game.height*0.37);

    this.graphics.beginFill(0xff0000);
    this.graphics.drawRect(0, 0, 670, 500);
    this.graphics.endFill();

    this.graphics.x = this.barGroup.x -70;
    this.graphics.y = this.game.height*0.37;
    this.barGroup.mask = this.graphics;

    this.setBar(0, 1);
    this.setBar(1, 3);
    this.setBar(2, 9);

}

function startSpin(){
    if(this.trys <= 0 || !this.canSpin) return;
    this.trys--;
    this.pointsCount++;
    this.canSpin = false;
    this.spin.alpha = 0.9


    this.spinTween.pause()

    this.spinning();
    
    //this.game.time.events.add(1500, function(){this.canSpin = true;  this.spin.alpha = 1;this.spinTween.resume()})
}

function setBar(i, pos) {
    var bar = this.barGroup.getChildAt(i);
     bar.tilePosition.y = -(pos) * 153;
}

function spinBars() {
    this.barGroup.forEach(function(bar) {
        if (bar.active == true) {
            bar.tilePosition.y -= bar.spins * 20;
            //if the bar is at the end of a spin
            //which is when the y position
            //is less than the negative height of the bar
            //
            if (bar.tilePosition.y < -1533) { //1520 1071
                bar.tilePosition.y = 0;
                //then subtract a spin
                bar.spins--;
                //if out of spins then
                if (bar.spins <= 0) {
                    bar.active = false;
                    //do the final spin
                    //which is a tween
                    this.finalSpin(bar);
                }
            }
        }
    }.bind(this));
}

function finalSpin(bar) {
    var ty = -(bar.stopPoint) * 153;
    var finalTween = game.add.tween(bar.tilePosition).to({
        y: ty
    }, 400, Phaser.Easing.Linear.None, true);
    finalTween.onComplete.add(function(){
        
        var me = this;
        console.log(me.pointsGuide[me.pointsCount])
        var pointsTween = me.game.add.tween(me);
        pointsTween.to({ pointsScore: pointsScore+me.pointsGuide[me.pointsCount]}, 200, Phaser.Easing.Linear.None, true, 350);
        
        pointsTween.onUpdateCallback(function(){
            me.pointsText.setText(Math.floor(me.pointsScore));
        }, this);

        pointsTween.onComplete.addOnce(function(){
            me.pointsText.setText(Math.floor(me.pointsScore));
        }, this);

        this.canSpin = true;  this.spin.alpha = 1;this.spinTween.resume();

        if(this.trys == 2){
            this.msgCoinsTween.start();
            this.msgWinTween.start();
        }
        else if(this.trys == 1){
            this.msgWin.loadTexture('atlas','2w.png')
            this.msgCoinsTween.start();
            this.msgWinTween.start();
        }
        else if(this.trys == 0){
            this.callCTA();
            this.moneyRain.flow(5500, 1000, 5, -1);
        }
    })
}

function spinning() {
    var s1 = game.rnd.integerInRange(0, 9);
    var s2 = game.rnd.integerInRange(0, 9);
    var s3 = game.rnd.integerInRange(0, 9);
    //set which frame to stop on
    //first value is which bar
    //second value is number to stop on
    //
    //
    if(this.trys == 2){
        this.setStop(0, s1);
        this.setStop(1, s2);
        this.setStop(2, s3);
    }
    else if(this.trys == 1){
        this.setStop(0, s1);
        this.setStop(1, s2);
        this.setStop(2, s3);
    }
    else if(this.trys == 0){
        this.setStop(0, 9);
        this.setStop(1, 9);
        this.setStop(2, 9);
    }



    this.spinTimer = game.time.events.loop(Phaser.Timer.SECOND / 1000, this.spinBars, this);
}
function setStop(i, stopPoint) {
    var bar = this.barGroup.getChildAt(i);
    bar.stopPoint = stopPoint;
    bar.active=true;
    bar.spins = 10;
}

